comment: |-
  SELECT T1.name,
         T2.date_of_treatment
  FROM Dogs AS T1
  JOIN Treatments AS T2 ON T1.dog_id = T2.dog_id
  WHERE T1.breed_code =
      (SELECT breed_code
       FROM Dogs
       GROUP BY breed_code
       ORDER BY count(*) ASC
       LIMIT 1)

